import React, { Component } from 'react';
import Slider from 'rc-slider';
//import 'rc-slider/assets/index.css'; // Import the default styles

class Search extends Component {
  constructor(props) {
    super(props);
    this.state = {
      frequency: 30, // Default frequency value
      selectedOption: 'all', // Default filter option
    };
  }

  handleFrequencyChange = (value) => {
    this.setState({ frequency: value });
    // You can add code here to filter the user list based on the selected frequency.
  }

  handleFilterChange = (e) => {
    this.setState({ selectedOption: e.target.value });
    // You can add code here to filter the user list based on the selected filter option.
  }

  render() {
    return (
      <div className="search-container">
        <div className="filters-drawer">
          <h3>Frequency: {this.state.frequency} Hz</h3>
          <Slider
            min={20}
            max={20000}
            step={10}
            value={this.state.frequency}
            onChange={this.handleFrequencyChange}
          />
          <h3>Filter by:</h3>
          <select
            value={this.state.selectedOption}
            onChange={this.handleFilterChange}
          >
            <option value="all">All</option>
            <option value="option1">Option 1</option>
            <option value="option2">Option 2</option>
            <option value="option3">Option 3</option>
            {/* Add more filter options as needed */}
          </select>
        </div>
        {/* Add your search button or functionality here */}
      </div>
    );
  }
}

export default Search;
